(window.webpackJsonp=window.webpackJsonp||[]).push([[738],{1090:function(n,h,g){"use strict";g.r(h);var t=g(44),i=Object(t.a)({},(function(){var n=this,h=n.$createElement,g=n._self._c||h;return g("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[g("h1",{attrs:{id:"chuong-1638-tuong-phi-phi"}},[g("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1638-tuong-phi-phi"}},[n._v("#")]),n._v(" Chương 1638: Tưỏng Phỉ Phỉ")]),n._v(" "),g("hr"),n._v(" "),g("p",[n._v("Chương 1638: Tưỏng Phỉ Phỉ"),g("br"),g("br"),n._v("Hơn mười phút sau."),g("br"),g("br"),n._v("Trương Huyền ngừng lại, mặt mũi bất đắc dĩ."),g("br"),g("br"),n._v("“Ta liền nói, không có tốt như vậy tu luyện...” To lớn hồn thể, xoa xoa mi tâm."),g("br"),g("br"),n._v("Vốn cho rằng, từ Lạc gia lấy được nhiều bảo vật, có thể trực tiếp để hồn thể phá tan Kim Thân cảnh, đạt tới Đại Thánh nhị trọng cảnh giới đại viên mãn, nằm mơ đều không có nghĩ đến, còn không có triệt để đột phá, độ tinh thuần liền không đủ!"),g("br"),g("br"),n._v("Những bảo vật này, đối với những người khác đủ để tu luyện tới Đại Thánh tứ trọng Bất Hủ cảnh, nhưng Trương Huyền bất luận chân khí vẫn là vu hồn, luyện đều là Thiên đạo công pháp, lại đi qua lôi đình rèn luyện, toàn thân cao thấp hầu như không có bất kỳ cái gì tạp chất, bảo vật bên trong linh khí cấp bậc mặc dù không thấp, nhưng so sánh cùng nhau, vẫn là kém một đoạn."),g("br"),g("br"),n._v("Lại không cách nào cung cấp động lực, để hắn đột phá."),g("br"),g("br"),n._v("Thật vất vả gom góp công pháp, lần nữa bởi vì linh khí độ tinh thuần, mà dừng lại, Trương Huyền than thở một tiếng."),g("br"),g("br"),n._v("“Lạc Càn Trinh đi theo, thật không tiện, cầm quá nhiều, Tưởng gia không dính dáng cái này... Đã phản bội nhân tộc, cầm được càng nhiều, đối nhân tộc làm hại cũng liền càng nhỏ!”"),g("br"),g("br"),n._v("Con mắt đột nhiên sáng lên."),g("br"),g("br"),n._v("Lúc trước tại Lạc gia thời điểm, bản thân thân là Lạc gia gia chủ, tuy là có quyền hạn, nhưng cũng không đến mức cầm quá nhiều, bây giờ tại Tưởng gia, hoàn toàn không có cái này cố kỵ."),g("br"),g("br"),n._v("Dù sao đều phản bội nhân tộc, cho đối phương lưu thêm điểm một cái, chẳng khác nào đối nhân tộc nhiều một phần làm hại, đã như vậy, cũng không có gì có thể khách khí."),g("br"),g("br"),n._v("Nghĩ đến cái này, không có quá nhiều chần chừ, vu hồn lần nữa trở lại thân thể, từ không gian gấp đi ra."),g("br"),g("br"),n._v("Bên ngoài vẫn như cũ mười phần yên tĩnh, hiển nhiên không có người muốn lấy được có người ngoài chui vào tàng thư các, hơn nữa, đem tất cả thư tịch đều xem xong."),g("br"),g("br"),n._v("“Vừa rồi tới thời điểm, nhìn rõ ràng, bảo tàng các phương hướng, ở bên kia, đi qua nhìn một chút!”"),g("br"),g("br"),n._v("Mượn đối không gian lý giải, lặng lẽ đi ra tàng thư khố, xác định phương hướng, thẳng tắp bay lượn mà đi."),g("br"),g("br"),n._v("Chỉ chốc lát đi tới trước mặt."),g("br"),g("br"),n._v("Nơi này phong ấn rõ ràng so tàng thư các càng thêm cường đại, từng tầng từng tầng bố trí đến, để cho người ta một cái nhìn không thấu."),g("br"),g("br"),n._v("Đang định mượn thư viện, tìm kiếm thiếu hụt, lặng yên không tiếng động chui vào, liền nghe đến có tiếng bước chân, từ nơi không xa truyền tới."),g("br"),g("br"),n._v("Thân thể nhoáng một cái, đi tới một cái góc, ngón tay điểm một cái, đem không gian bốn phía phong cấm, mới vừa làm xong, liền thấy hai bóng người đi vào sân nhỏ."),g("br"),g("br"),n._v("Vậy mà đều là người quen."),g("br"),g("br"),n._v("Bên trái trung niên nhân, là trước kia nhìn thấy tộc trưởng Tưỏng Phương Du, bên phải chính là cái dáng người cao gầy nữ hài, giữa hai lông mày mang theo khí khái hào hùng, chính là trước đó tại Thánh tử điện thấy qua thiên công Thánh tử, Tưỏng Phỉ Phỉ."),g("br"),g("br"),n._v("“Cha...”"),g("br"),g("br"),n._v("Được đưa tới nơi này, nữ hài có chút không quá cao hứng, nhíu nhíu mày, nhịn không được nói."),g("br"),g("br"),n._v("“Trước ngươi tiêu tốn nhiều hơn nữa tinh lực, nghiên cứu thiên công sư chức nghiệp, ta cũng đều tùy ngươi, nhưng mà bây giờ thì khác, đại lục cục diện sẽ đại biến, làm không cẩn thận, đại loạn sắp nổi, thân là chúng ta Tưởng gia, huyết mạch độ tinh thuần cao nhất thiên tài, nhất định phải gánh vác nhận trách nhiệm!”"),g("br"),g("br"),n._v("Lông mày nhăn lại, Tưỏng Phương Du nói."),g("br"),g("br"),n._v("“Ta thực lực bây giờ, cha cũng không phải không biết, khoảng cách Thánh vực bát trọng, cũng không biết có còn xa lắm không, coi như muốn gánh vác trách nhiệm, lại có thể gánh vác cái gì...”"),g("br"),n._v("Tưỏng Phỉ Phỉ mặt mũi không tình nguyện."),g("br"),g("br"),n._v("“Chúng ta Tưởng gia, cường đại nhất không phải thân thể tu vi, mà là linh hồn! Ngươi huyết mạch mạnh mẽ, hồn thể từ nhỏ đã vượt xa người thường, nếu như có thể lĩnh ngộ tiên tổ linh hồn chân giải, có thể lập tức nhận được tổ tiên truyền thừa, từ đó thực lực tăng nhiều!”"),g("br"),g("br"),n._v("Giải thích một câu, Tưỏng Phương Du trong mắt mang theo nồng đậm kỳ vọng: “Đây không phải chuyện cười, không chỉ dính dáng chúng ta Tưởng gia nhất tộc hưng suy, làm không cẩn thận, mạng cũng bị mất... Lúc này, lại không có thể đùa nghịch tiểu tính tình!”"),g("br"),g("br"),n._v("“Biết...”"),g("br"),g("br"),n._v("Thấy cha nói nghiêm trọng như vậy, Tưỏng Phỉ Phỉ mặt mũi bất đắc dĩ: “Ta tận lực còn không được ư? Có điều, linh hồn chân giải, khó có thể lý giải được, vô số tiền bối, đều rất khó làm được, ta cũng chưa chắc có thể thành!”"),g("br"),g("br"),n._v("  “Tận lực a, mới vừa truyền đến tin tức, Trương gia vị kia Trương Huyền, hư hư thực thực lĩnh ngộ thời gian chân giải, Lạc gia Lạc Thiên Nhai, xác nhận lĩnh ngộ không gian phong cấm chân giải... Tam đại gia tộc, chỉ có chúng ta Tưởng gia chậm nhất!” Tưỏng Phương Du than thở."),g("br"),g("br"),n._v("“Trương gia Trương Huyền, là yêu nghiệt cấp nhân vật, càng là Thánh tử điện điện chủ, có thể lĩnh ngộ thời gian chân giải, cũng không ngoài ý muốn! Chỉ là... Ngươi nói cái này Lạc Thiên Nhai là ai?” Tưỏng Phỉ Phỉ nghi ngờ nhìn qua."),g("br"),g("br"),n._v("Lạc gia xác lập chuyện của gia chủ, truyền còn không ra, cũng chỉ có trong tộc số ít người cầm quyền biết."),g("br"),g("br"),n._v("Nàng quanh năm tại Thánh tử điện học tập, không ở nhà, cũng không có mình thế lực, biết cũng không quá rõ ràng."),g("br"),g("br"),n._v("“Lạc Thiên Nhai, nghe nói là Lạc gia bàng chi, trước đó không lộ ra trước mắt người đời, đột nhiên liền lĩnh ngộ không gian chân giải, huyết mạch độ tinh thuần cũng đạt tới ‘Chín’, càng đem Chư Tử bách gia Tử Dung Cổ Thánh hậu nhân đánh bại!” Tưỏng Phương Du giải thích."),g("br"),g("br"),n._v("Vừa nói, hắn cũng vẫn như cũ có chút không tin."),g("br"),g("br"),n._v("Không thể không nói, Lạc gia, vận may thật quá tốt rồi."),g("br"),g("br"),n._v("Trương gia mới vừa tìm về tiểu thiên tài, danh chấn đại lục, Lạc gia liền toát ra một cái lĩnh ngộ không gian chân giải Lạc Thiên Nhai... Tam đại gia tộc, hiện nay bọn họ Tưởng gia sự suy thoái, không vội vã đều không được."),g("br"),g("br"),n._v("“Bàng chi? Cha, thực sự không được, ngươi cũng tìm xem, nhìn một chút chúng ta Tưởng gia có hay không lĩnh ngộ linh hồn chân giải bàng chi... Cũng để cho hắn làm tộc trưởng không được sao?”"),g("br"),g("br"),n._v("Nghe được con gái lời nói, Tưỏng Phương Du nhịn không được đập đầu của đối phương một chút, mặt mũi im lặng: “Uổng cho ngươi nghĩ ra, ngươi cái này hạch tâm nhất đệ tử, đều lĩnh ngộ không được chân giải, trông cậy vào bàng chi... Đây không phải mơ mộng hão huyền ư? Có thể ra một cái Lạc Thiên Nhai là tốt lắm rồi, ngươi thật đúng là cho rằng, loại cường giả cấp bậc này, thật sự là rau cải trắng, một trảo một nắm lớn?”"),g("br"),g("br"),n._v("“Người ta gia tộc, có loại này lợi hại bàng chi, gia tộc bọn ta ngộ nhỡ cũng có đây...” Tưỏng Phỉ Phỉ lẩm bẩm miệng."),g("br"),g("br"),n._v("Nói thật, nàng mặc dù linh hồn có một không hai, tại Tưởng gia huyết mạch cũng là cao nhất, nhưng bản thân cũng không thích tu luyện, mà là am hiểu thiên công chức nghiệp, nguyên nhân chính là như vậy, mới có thể trở thành thiên công Thánh tử, tại Thánh tử điện, đều tên tuổi lẫy lừng."),g("br"),g("br"),n._v("Chỉ bất quá... Rất hiển nhiên, trong tộc sẽ không để cho nàng tiếp tục truy cầu mình thích chức nghiệp."),g("br"),g("br"),n._v("“Nếu là thật có, ta lập tức kính mời tới, lập hắn làm gia chủ!”"),g("br"),g("br"),n._v("Nghe được con gái thanh âm, Tưỏng Phương Du hừ một tiếng: “Tốt rồi, chớ suy nghĩ lung tung, đi vào nhanh một chút a, ngươi bây giờ cần phải làm là đến Tưởng gia ngọc bích phía trước cảm ngộ tu luyện, tranh thủ sớm ngày lĩnh ngộ chân giải! Cái khác, cũng không nên nghĩ, nếu không... Vì trong tộc vững chắc, vì tộc nhân có thể ứng đối tiếp xuống náo động... Cũng chỉ có thể thông gia, để ngươi gả cho thế lực càng mạnh mẽ hơn, tốt bảo tồn gia tộc hỏa chủng!”"),g("br"),g("br"),n._v("“Cha, ta không muốn lấy chồng...” Nghe được lĩnh ngộ không được, liền thông gia, Tưỏng Phỉ Phỉ giật nảy mình, vội vàng lắc đầu."),g("br"),g("br"),n._v("“Cái này không phải do ngươi, lần này nguy cơ cực lớn, không thông gia, chỉ bằng vào chúng ta Tưởng gia một cái, căn bản là không có cách vượt qua...”"),g("br"),g("br"),n._v("Than thở một tiếng, Tưỏng Phương Du ánh mắt lộ ra vẻ bất đắc dĩ: “Bất quá, ngươi yên tâm, coi như thông gia, hoặc là Trương gia vị kia Trương Huyền, hoặc là Lạc gia vị kia Lạc Thiên Nhai, tóm lại... Không có khả năng để ngươi chịu ủy khuất!”"),g("br"),g("br"),n._v("Người đăng: ThấtDạ"),g("br"),g("br"),g("br"),g("br")]),n._v(" "),g("hr"),n._v(" "),g("p",[g("a",{attrs:{href:"./chap-1649"}},[n._v("Chương trước")]),n._v("  |  "),g("a",{attrs:{href:"./chap-1651"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);